import React from "react";
import Button from '../components/Button'

const Nav = (props) => {
    return (
        <div className="nav-bar">
            <ul>
                <li>Home</li>
                <li>Explore</li>
                <li>About</li>
                <li>Gallery</li>
            </ul>
            <a href="./login"><Button /></a>
        </div>
    )
}

export default Nav;
